import { FunctionComponent } from "react";
import { resourceEndPoint } from "../../API/apiEndpoint";
import "./post.css";

interface PostProps {
  id: string;
  caption: string;
  name:string
  imageUrl: string;
  Likes: number;
  ProfilePic: string;
  Comments: Array<any>;
}

const Post: FunctionComponent<PostProps> = ({id,name,caption,imageUrl,Likes,ProfilePic,Comments}) => {
  return <div className="post-container">
        <div className="post-container__initails">
            <div className="post-container__initails-profile"><img src={resourceEndPoint + `/${ProfilePic}`}></img></div>
            <div><p>{name}</p></div>
        </div>
  </div>;
};

export default Post;
